{"body":[{"notHandleType":0,"problem_id":2,"rejectReason":"","status":"1","errorUrl":"https://www.pengan.gov.cn/xwdt/bmdt/202112/t20211215_1373151.html","transactUnit":"蓬安县电子政务服务中心","newOldDataFlag":1,"type":0,"createtime":"2024-01-18","id":311946,"wzmc":"蓬安县人民政府","displayContent":null,"description":"对党员个人而言，将党费给党组织是一种主动行为，用“交纳党费”；对党组织而言，应做好党费收缴、使用和管理工作，用“收缴党费”。","transactTime":"2024-01-19","transactResult":"周先生，你好！你反映我县门户网站错别字问题，经查，情况属实。我中心已对门户网站进行了全站检索，对检索出来的相关内容指定相关部门予以修改。感谢你对我县门户网站的关注。

