请问哪个才是准确的？​","transactTime":"2024-01-17","transactResult":"尊敬的市民朋友您好，关于您反映的两条负责人信息不一致的问题，我们第一时间进行了核查处理，现已撤回区招商投资促进局的相关信息。我们将吸取教训，杜绝类似情况再发生。感谢您对万州区人民政府工作的关心和支持！"}],"hasMoreItems":false}

{"body":[{"notHandleType":0,"problem_id":1,"rejectReason":"","status":"22","errorUrl":"https://lingao.hainan.gov.cn/ptjs/lxwm/201903/t20190328_2481170.html","transactUnit":"临高县党政信息中心","newOldDataFlag":1,"type":0,"createtime":"2024-01-10","id":311080,"wzmc":"临高县人民政府网站","displayContent":null,"description":"第1个网址：https://lingao.hainan.gov.cn/jgzc_33805/zzf/
