第1个网址里，镇政府 没有 临高县和舍镇，， 第2个网址里又有  临高县和舍镇的活动信息。 临高到底没有 和舍镇 ？","transactTime":"2024-01-11","transactResult":"因镇政府栏目存在多页信息，临高县和舍镇刚好在第2页页面，没有不存在临高县和舍镇。"}],"hasMoreItems":false}

{"body":[{"notHandleType":0,"problem_id":2,"rejectReason":"","status":"1","errorUrl":"http://www.wz.gov.cn/bmjz_89642/jz/cjbjd_96290/zwgk_96294/fdzdgknr_96296/jgjj/bmldxx/202311/t20231121_12586854.html","transactUnit":"万州区人民政府办公室","newOldDataFlag":1,"type":0,"createtime":"2024-01-02","id":310021,"wzmc":"重庆市万州区人民政府","displayContent":null,"description":"重庆市万州区陈家坝街道党工委委员、人大工委主任，谭小林，男，汉族，1974年1月生，中专，中共党员。
重庆市万州区天城街道党工委委员、人大工委主任，谭小林，男，汉族，1974年1月，大学，中共党员。

一人兼两职吗？学历还不一样。","transactTime":"2024-01-04","transactResult":"尊敬的市民朋友您好，关于您反映的两条负责人信息重复问题，我们第一时间进行了核查。经查，问题属实。该同志工作岗位新调整后，两个街道在信息公开方面未沟通到位，未做到同步且出现偏差，致使出现两条类似信息。我们已督促两个街道对情况进行了核实处理，天城街道第一时间撤回了相关信息，陈家坝街道对学历进行了修改。我们将吸取教训，杜绝类似情况再发生。感谢您对万州区人民政府工作的关心和支持！"}],"hasMoreItems":false}
